import { Box, Grid } from "@mui/material";
import React from "react";
import Chart from "react-apexcharts";
import {
  LEFT_SIDE_CHART_SERIES,
  LEFT_SIDE_CHART_OPTIONS,
  RIGHT_SIDE__CHART_SERIES,
  RIGHT_HAND_CHART_OPTIONS,
} from "./constants";

const BarChart = () => {
  return (
    <Grid sx={{ display: "flex", width: "100%" }}>
      <Box sx={{ width: "50%" }}>
        <Chart
          options={LEFT_SIDE_CHART_OPTIONS}
          series={LEFT_SIDE_CHART_SERIES}
          type="bar"
          height={600}
        />
      </Box>
      <Box sx={{ width: "50%" }}>
        <Chart
          options={RIGHT_HAND_CHART_OPTIONS}
          series={RIGHT_SIDE__CHART_SERIES}
          type="bar"
          height={600}
        />
      </Box>
    </Grid>
  );
};

export default BarChart;
